import React from 'react';

import './index.css';
import './comadreja.scss';
import 'bootstrap/dist/css/bootstrap.css';

function App() {
  return (
    <div>
      <h1>Registro</h1>
        <div>
          <div className="form-group">
            <label htmlFor="empresaNombre" className="h2">Nombre de la empresa</label>
            <input class="form-control form-control-lg focus-secondary" type="text" className="form-control" id="empresaNombre" aria-describedby="emailHelp" placeholder="Nombre de la empresa" />
          </div>
          <div className="form-group">
            <label htmlFor="empresaCorreo">Direccion de correo electronico</label>
            <input type="text" className="form-control" id="empresaEmail" aria-describedby="emailHelp" placeholder="correo de la empresa" />
          </div>
        </div>
      <div className="form-group">
        <label htmlFor="telefono">Numero de telefono</label>
        <input type="text" className="form-control" id="empresaTelenofo" aria-describedby="emailHelp" placeholder="telefono de la empresa" />
      </div>      <div className="form-group">
        <label htmlFor="empresaCedula">Cedula juridica</label>
        <input type="text" className="form-control" id="empresaCedulaJuridica" aria-describedby="emailHelp" placeholder="cedula juridica" />
      </div>
    </div>
  );
}

export default App;
